import React from 'react';
import Header from './Header'
import './App.css';
import './index.css';
import "./Footer";
import Cadastro from './Cadastro';
import Cards from './Cards';
import Footer from './Footer';
import Input from './Input';



function App() {
  return (
    <div className="App">
    <Header name="Eco-Via"></Header>
    <Form>
      <Input name="nome"/>
    </Form>



    <Cadastro></Cadastro>

    <Footer></Footer>
    </div>

  );
}

export default App;
